import React, { useEffect, useState } from "react";
import pb from "../utils/pocketbaseClient";
import ConversionBox from "./ConversionBox";
import ComparisonBox from "./ComparisonBox";
import Toggle from "./Toggle";
import { parseScientific } from "../utils/parseScientific";
import { useTheme } from "../context/ThemeContext";

function Converter({ categoryId }) {
  const { theme } = useTheme();

  const [units, setUnits] = useState([]);
  const [realItems, setRealItems] = useState([]);

  const [inputValue, setInputValue] = useState(1);
  const [fromUnit, setFromUnit] = useState(null);

  const [convertedValues, setConvertedValues] = useState([]);
  const [displayType, setDisplayType] = useState("general");

  const [selectedItems, setSelectedItems] = useState([null, null, null]);
  const [comparisonDisplayType, setComparisonDisplayType] = useState("general");

  // Fetch units
  useEffect(() => {
    const fetchUnits = async () => {
      try {
        const records = await pb.collection("units").getFullList({
          filter: `category="${categoryId}"`,
        });

        const sorted = [...records].sort((a, b) => a.value - b.value);
        setUnits(sorted);
        setFromUnit(sorted[0]); // default fromUnit
      } catch (error) {
        console.error("Error fetching units:", error);
      }
    };

    fetchUnits();
  }, [categoryId]);

  // Fetch real-world items
  useEffect(() => {
    const fetchRealItems = async () => {
      try {
        const records = await pb.collection("real_world_items").getFullList({
          filter: `category="${categoryId}"`,
        });

        const sortedItems = [...records].sort((a, b) => a.value - b.value);

        // Exclude "Black Hole" as default for first box
        const default1 = sortedItems.find((item) => item.name !== "Black Hole") || sortedItems[0];
        const default2 = sortedItems[1] || null;
        const default3 = sortedItems[2] || null;

        setRealItems(sortedItems);
        setSelectedItems([default1, default2, default3]);
      } catch (error) {
        console.error("Error fetching real-world items:", error);
      }
    };

    fetchRealItems();
  }, [categoryId]);

  // Conversion calculation
  useEffect(() => {
    if (!fromUnit || units.length === 0) return;

    const baseValue = inputValue * fromUnit.to_base_factor;

    const converted = units.map((unit) => ({
      ...unit,
      convertedValue: baseValue / unit.to_base_factor,
    }));

    setConvertedValues(converted);
  }, [inputValue, fromUnit, units]);

  return (
    <div className="w-full grid grid-cols-1 md:grid-cols-2 gap-6">
      {/* Unit Conversion Section */}
      <div className="space-y-4">
        <div className="flex items-center justify-between">
          <h2 className="text-xl font-semibold" style={{ color: theme?.mainHeadingColor }}>Unit Conversion</h2>
          <Toggle displayType={displayType} setDisplayType={setDisplayType} />
        </div>

        <div className="grid grid-cols-1 sm:grid-cols-3 gap-4">
          {Array(3)
            .fill(null)
            .map((_, index) => (
              <ConversionBox
                key={index}
                index={index}
                inputValue={inputValue}
                setInputValue={setInputValue}
                units={units}
                fromUnit={fromUnit}
                setFromUnit={setFromUnit}
                convertedValues={convertedValues}
                displayType={displayType}
              />
            ))}
        </div>
      </div>

      {/* Real-world Comparison Section */}
      <div className="space-y-4">
        <div className="flex items-center justify-between">
          <h2 className="text-xl font-semibold" style={{ color: theme?.mainHeadingColor }}>Real-World Comparison</h2>
          <Toggle displayType={comparisonDisplayType} setDisplayType={setComparisonDisplayType} />
        </div>

        <div className="grid grid-cols-1 sm:grid-cols-3 gap-4">
          {selectedItems.map((selectedItem, index) => (
            <ComparisonBox
              key={index}
              index={index}
              selectedItem={selectedItem}
              setSelectedItems={setSelectedItems}
              selectedItems={selectedItems}
              realItems={realItems}
              inputValue={inputValue}
              comparisonDisplayType={comparisonDisplayType}
            />
          ))}
        </div>
      </div>
    </div>
  );
}

export default Converter;
